import React, { useState } from 'react'

function CreateUser() {
    const [name, setName] = useState("");
    const [email, setEmail] = useState();
    const [password, setPassword] = useState(); 
  return (
    <div>
            <h3> CreateUse</h3> 
            <form>
            <label>Name:<input type='text' value={name} onChange={(e)=> setName(e.target.value)} /></label><br /><br />
            <label>Email:<input type='email' value={email} onChange={(e)=> setEmail(e.target.value)} /> </label><br /><br />
            <label>Password:<input type='password' /></label><br /><br />
            <button>submit</button>

            </form>
    </div>
  )
}

export default CreateUser
